import React from "react";
import * as S from "./styled";
const Heading1 = () => {
  return <S.Heading1 />;
};

const Heading2 = () => {
  return <S.Heading2 />;
};
const Heading3 = () => {
  return <S.Heading3 />;
};
const Text = () => {
  return <S.Text />;
};

export { Heading1, Heading2, Heading3, Text };
